import React, { Component } from 'react';

import PopUpGift from "./PopUpGift";


class CardGift extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="col-12 col-md-6 col-lg-4">
                <PopUpGift
                    {...this.props}
                    company={this.props.name}
                />
            </div>
        );
    }
}

export {
    CardGift as default
};
